import { Link } from "react-router-dom";
import logo_service from "../components/img/logo_service.jpg";

const Navbar = ({ user }) => {
  const logout = () => {
    localStorage.removeItem('token');
    window.open("http://localhost:5000/auth/logout", "_self");
  };
  const dashboard = () => {
    window.open(`http://localhost:3000/dashboard/${user._id}`, "_self");
  }
  const aboutUs = () => {
    window.open("http://localhost:3000/aboutus", "_self");
  }
  const contact = () => {
    window.open("http://localhost:3000/contact", "_self");
  }
  const user_name = () => {
    return user.displayName;
  }
  const user_image = () => {
    return user.profileImage;
  }
  return (
    <div className="navbar">
      <span className="logo">
      <Link className="service_logo" to="/">
        <img className="service_logo_image" src={logo_service} alt="Logo" />
        <span>GAB AUTO GARAGE</span>
      </Link>
      </span>
      {user ? (
        <ul className="list">
          <li className="listItem">
            <img
              src={user_image()}
              alt=""
              className="avatar"
            />
          </li>
          <li className="link_2">{user_name()}</li>
          <li className="link" onClick={dashboard}>
            Dashboard
          </li>
          <li className="link" onClick={logout}>
            Logout
          </li>
          <li className="link" onClick={aboutUs}>
            About Us
          </li>
          <li className="link" onClick={contact}>
            Contact
          </li>
        </ul>
      ) : (
        <>
          <Link className="link" to="login">
            Login
          </Link>
          <Link className="link" to="aboutus">
            About Us
          </Link>
          <Link className="link" to="aboutus">
            Contact
          </Link>
        </>
      )}
    </div>
  );
};

export default Navbar;
